import React from 'react'
import { Link } from 'react-router-dom';
import './Navigation.css'


function EquipmentNavigation({onClose, data, handleChoseCategory, equipment}) {
//onClose()
  function getFiterProduct() {
    handleChoseCategory(equipment, data.slug)

  }

  return (
    <li className='equipment-navigation__list' onClick={onClose}>
      <button className='navigation__listlink' onClick={getFiterProduct}>{data.name}</button>
    </li>
  )
}

export default EquipmentNavigation;
